import 'date-fns';
import React from 'react';
import Grid from '@material-ui/core/Grid';
import DateFnsUtils from '@date-io/date-fns';
import {
  MuiPickersUtilsProvider,
  KeyboardDateTimePicker, 
  KeyboardDatePicker,KeyboardTimePicker
} from '@material-ui/pickers';

export default function MaterialUIPickers(props) {

  if(props.tanggalOnly && props.showTime){
    return (
      <MuiPickersUtilsProvider utils={DateFnsUtils}>
          <KeyboardDateTimePicker
            margin="normal"
            id={props.label}
            label={props.label ? props.label:""}
            format={props.format ? props.format :"MM/dd/yyyy HH:mm"}
            value={props.value}
            onChange={props.onChange}
            KeyboardButtonProps={{
              'aria-label': 'change date',
            }}
            style={props.style?props.style:{}}
          />

      </MuiPickersUtilsProvider>
    );
  }else if(props.tanggalOnly){
    return (
      <MuiPickersUtilsProvider utils={DateFnsUtils}>
          < KeyboardDatePicker
            margin="normal"
            id="date-picker-dialog"
            label={props.label ? props.label:""}
            format={props.format ? props.format :"MM/dd/yyyy"}
            value={props.value}
            onChange={props.onChange}
            KeyboardButtonProps={{
              'aria-label': 'change date',
            }}
            InputProps={props.InputProps}
            style={props.style?props.style:{}}
          />
      </MuiPickersUtilsProvider>
    );
  }else if(props.timeOnly){
    return(
      <MuiPickersUtilsProvider utils={DateFnsUtils}>
      
        <KeyboardTimePicker
          margin="normal"
          id="time-picker"
          label={props.label ? props.label:""}
          value={props.value}
          onChange={props.onChange}
          KeyboardButtonProps={{
            'aria-label': 'change time',
          }}
          style={props.style?props.style:{}}

        />
    
    </MuiPickersUtilsProvider>
    )
  }
 
}
